import React, { useState } from 'react'

export default function About() {
  const temp = `https://source.unsplash.com/400x300/?{imgo}`;
  const [imgo, setImg] = useState('');
  const inputEevent = (event)=>{
    const data = event.target.value;
    setImg(data);
  }
  return (
    <div>
      <h1>This is About Me Page</h1>
      <br />
      <input type="text" value={imgo} onChange={inputEevent}/>
      <img src={temp} alt="f" />
    </div>
  )
}
